import React from 'react'

const userInfoStyle = {
    height: '100vh',
    border: "1px solid red",
}

export default function UserInfo() {
  return (
    <div>
      <div>
        Name: <input type="text" />
      </div>
      <div>
        City: <input type="text" />
      </div>
      <div>
        Pincode: <input type="text" />
      </div>
      <div>
        Country: City<input type="text" />
      </div>
    </div>
  );
}
